        fetch('http://localhost:1337/api/blogs',{
            method : 'GET'
        })
        .then()
        .then()
        .catch();
    }

    useEffect(() => {
        fetchBlog();
    }, [])

    return (
        <div>EditBlog</div>
    )
}
